import React from 'react';
import { ExampEProps } from './ExampE.propTypes';
import styles from './ExampE.styles.scss';

const ExampE = props => {
    return (
        <div>
            <ul>
                {props.trips.map(trips => (
                    <li key={trips} className="list-group-item">
                    <img alt="trips" src={trips.image} className="img-fluid" />
                  </li>
                ))}
        </ul>
        </div>
    );
};

ExampE.propTypes = ExampEProps.propTypes;
ExampE.defaultProps = ExampEProps.defaultProps;

export default ExampE;
